import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';

export default class HomeCarousel extends Component{
	render(){
		return (
			<Carousel autoplay showArrows={true} showThumbs={false}>
				<div key="slide1" style={{padding: 20, width:150}}>
					<img alt="" src="http://lorempixel.com/output/cats-q-c-640-480-1.jpg" />
				</div>
				<div key="slide2" style={{padding: 20, width:150}}>
					<img alt="" src="http://lorempixel.com/output/cats-q-c-640-480-2.jpg" />
				</div>
				<div key="slide3" style={{padding: 20, width:150}}>
					<img alt="" src="http://lorempixel.com/output/cats-q-c-640-480-3.jpg" />
				</div>
			</Carousel>
		);
	}
};
